 with user data</h3><h3>Industry regulatory disclosure requirements</h3>', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-revision-v1', '', '', '2018-12-24 07:20:55', '2018-12-24 07:20:55', '', 3, 'http://edu.dewolfe.io/test/2018/12/24/3-revision-v1/', 0, 'revision', '', 0),
